// App.js
import React from 'react';
import EventRegistrationApp from './EventRegistrationApp';
import UserRegistrationPage from './UserRegistrationPage';
import { ToastContainer } from 'react-toastify';

function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/event-registration">Event Registration</Link>
            </li>
            <li>
              <Link to="/user-registration">User Registration</Link>
            </li>
          </ul>
        </nav>

        <Switch>
          <Route path="/event-registration">
            <EventRegistrationApp />
            <ToastContainer />

          </Route>
          <Route path="/user-registration">
            <UserRegistrationPage />
            <ToastContainer />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

function Home() {
  return <h2>Home</h2>;
}

export default App;
